commits.content:
.main {
  padding: 64px 20px;
  font-family: "Space Mono", Arial, sans-serif;
  &__img {
    width: 100%;
    height: 200px;
  }

  @include for-l-mobile {
    padding: 72px;
  }

  @include for-desktop {
    padding: 120px;
    &__img {
      width: 100%;
    }
  }

  &__container {
    margin: 48px 0;

    @include for-desktop {
      display: grid;
      grid-template-columns: repeat(3, 1fr);
      gap: 20px;
    }
  }
}
